var ISTJ = {title:"<h1>ISTJ</h1>" ,book1:"<h3>American Gods</h3>  <h4>By Neil Gaiman</h4>",book1des:"<p> Days before his release from prison, Shadow's wife, Laura, dies in a mysterious car crash. Numbly, he makes his way back home. On the plane, he encounters the enigmatic Mr Wednesday, who claims to be a refugee from a distant war, a former god and the king of America. Together they embark on a profoundly strange journey across the heart of the USA, whilst all around them a storm of preternatural and epic proportions threatens to break. Scary, gripping and deeply unsettling, American Gods takes a long, hard look into the soul of America. You'll be surprised by what - and who - it finds there... </p><p>Review by GoodReads</p>",book1img:`<img src="https://images.gr-assets.com/books/1462924585l/30165203.jpg" alt="">`,book2:"<h3>Unashamed</h3>  <h4>by Lecrae Moore</h4>",book2des:"<p>If you live for people's acceptance, you'll die from their rejection. Two-time Grammy winning rap artist, Lecrae, learned this lesson through more than his share of adversity—childhood abuse, drugs and alcoholism, a stint in rehab, an abortion, and an unsuccessful suicide attempt.This is the story of one man's journey to faith and freedom.</p><p>Review by GoodReads</p>",book2img:`<img src="data:image/jpeg;base64," alt="">`,book3:"<h3>Still Alice</h3>  <h4>by Lisa Genova</h4>",book3des:"<p>Alice Howland, happily married with three grown children and a house on the Cape, is a celebrated Harvard professor at the height of her career when she notices a forgetfulness creeping into her life. As confusion starts to cloud her thinking and her memory begins to fail her, she receives a devastating diagnosis: early onset Alzheimer's disease. Fiercely independent, Alice struggles to maintain her lifestyle and live in the moment, even as her sense of self is being stripped away. In turns heartbreaking, inspiring and terrifying, Still Alice captures in remarkable detail what's it's like to literally lose your mind...</p><p>Review by GoodReads</p>",book3img:`<img src="data:image/jpeg;base64," alt="">`,book4:"<h3>Shanghai Girls</h3>  <h4>by Lisa See</h4>",book4des:"<p>t centers on the complex relationship between two sisters, Pearl and May, as they go through great pain and suffering in leaving war-torn Shanghai, and try to adjust to the difficult roles of wives in arranged marriages and of Chinese immigrants to the U.S.</p> <p>by Wikipedia</p>",book4img:`<img src="data:image/jpeg;base64," alt="">`,book5:"<h3>The Historian</h3>  <h4>by Elizabeth Kostova</h4>",book5des:`<p>To you, perceptive reader, I bequeath my history....Late one night, exploring her father's library, a young woman finds an ancient book and a cache of yellowing letters. The letters are all addressed to "My dear and unfortunate successor," and they plunge her into a world she never dreamed of, a labyrinth where the secrets of her father's past and her mother's mysterious fate connect to an inconceivable evil hidden in the depths of history.</p><p>by GoodReads</p>`,book5img:`<img src="data:image/jpeg;base64," alt="">` }
var INFJ = {title:"<h1>INFJ</h1>" ,book1:"<h3>The Marriage Plot</h3>  <h4>by Jeffrey Eugenides</h4>",book1des:"<p>It's the early 1980s - the country is in a deep recession, and life after college is harder than ever. In the cafés on College Hill, the wised-up kids are inhaling Derrida and listening to the Talking Heads. But Madeleine Hanna, dutiful English major, is writing her senior thesis on Jane Austen and George Eliot, purveyors of the marriage plot that lies at the heart of the greatest English novels.As Madeleine tries to understand why `it became laughable to read writers like Cheever and Updike, who wrote about the suburbia Madeleine and most of her friends had grown up in, in favor of reading the Marquis de Sade, who wrote about deflowering virgins in eighteenth century France,` real life, in the form of two very different guys, intervenes. Leonard Bankhead - charismatic loner, college Darwinist, and lost Portland boy - suddenly turns up in a semiotics seminar, and soon Madeleine finds herself in a highly charged erotic and intellectual relationship with him. At the same time, her old friend Mitchell Grammaticus - who's been reading Christian mysticism and generally acting strange - resurfaces, obsessed with the idea that Madeleine is destined to be his mate.Are the great love stories of the nineteenth century dead? Or can there be a new story, written for today and alive to the realities of feminism, sexual freedom, prenups, and divorce? With devastating wit and an abiding understanding of and affection for his characters, Jeffrey Eugenides revives the motivating energies of the Novel, while creating a story so contemporary and fresh that it reads like the intimate journal of our own lives.</p><p>Review by GoodReads</p>",book1img:`<img src="data:image/jpeg;base64," alt="">`,book2:"<h3>The Chronicles of Narnia</h3>  <h4>by C.S. Lewis</h4>",book2des:`<p>It narrates the adventures of various children who play central roles in the unfolding history of the Narnian world. Except in The Horse and His Boy, the protagonists are all children from the real world who are magically transported to Narnia, where they are sometimes called upon by the lion Aslan to protect Narnia from evil. The books span the entire history of Narnia, from its creation in The Magician's Nephew to its eventual destruction in The Last Battle.</p><p>Review by GoodReads</p>`,book2img:`<img src="data:image/jpeg;base64," alt="">`,book3:"<h3>The Dark Tower </h3>  <h4>by Stephen King</h4>",book3des:"<p>In the first book of this brilliant series, Stephen King introduces readers to one of his most enigmatic heroes, Roland of Gilead, The Last Gunslinger. He is a haunting figure, a loner on a spellbinding journey into good and evil. In his desolate world, which frighteningly mirrors our own, Roland pursues The Man in Black, encounters an alluring woman named Alice, and begins a friendship with the Kid from Earth called Jake. Both grippingly realistic and eerily dreamlike, The Gunslinger leaves readers eagerly awaiting the next chapter.</p><p>Review by GoodReads</p>",book3img:`<img src="data:image/jpeg;base64," alt="">`,book4:"<h3>The Hitchhiker's Guide To The Galaxy</h3>  <h4>by Douglas Adams</h4>",book4des:`<p>Seconds before the Earth is demolished to make way for a galactic freeway, Arthur Dent is plucked off the planet by his friend Ford Prefect, a researcher for the revised edition of The Hitchhiker's Guide to the Galaxy who, for the last fifteen years, has been posing as an out-of-work actor.Together this dynamic pair begin a journey through space aided by quotes from The Hitchhiker's Guide ("A towel is about the most massively useful thing an interstellar hitchhiker can have") and a galaxy-full of fellow travelers: Zaphod Beeblebrox—the two-headed, three-armed ex-hippie and totally out-to-lunch president of the galaxy; Trillian, Zaphod's girlfriend (formally Tricia McMillan), whom Arthur tried to pick up at a cocktail party once upon a time zone; Marvin, a paranoid, brilliant, and chronically depressed robot; Veet Voojagig, a former graduate student who is obsessed with the disappearance of all the ballpoint pens he bought over the years. </p><p>Review by GoodReads</p>`,book4img:`<img src="data:image/jpeg;base64," alt="">`,book5:"<h3>The Kingkiller Chronicles</h3>  <h4>by Patrick Rothfuss</h4>",book5des:"<p>This suspenseful coming-of-age story folllows Kvothe as he recounts his transformation from a magically gifted young man into the most notorious wizard, musician, thief and assassin in his world.</p><p>Review by National Public Radio</p>",book5img:`<img src="data:image/jpeg;base64," alt="">` };
var ISFJ = {title:"<h1>ISFJ</h1>" ,book1:"<h3>When I Was a Child I Read Books</h3>  <h4>by Marilynne Robinson</h4>",book1des:"<p>In this new collection Marilynne Robinson returns to the themes which have preoccupied her work: the role of faith in modern life, the inadequacy of fact, the contradictions inherent in human nature. Clear-eyed and forceful as ever, Robinson demonstrates once again why she is regarded as a modern rhetorical master.</p><p>Review by GoodReads</p>",book1img:`<img src="data:image/jpeg;base64," alt="">`,book2:"<h3>The Nightingale</h3>  <h4>by Kristin Hannah</h4>",book2des:`<p>In love we find out who we want to be. In war we find out who we are.</p><p>France, 1939
In the quiet village of Carriveau, Vianne Mauriac says goodbye to her husband, Antoine, as he heads for the Front. She doesn’t believe that the Nazis will invade France...but invade they do, in droves of marching soldiers, in caravans of trucks and tanks, in planes that fill the skies and drop bombs upon the innocent. When France is overrun, Vianne is forced to take an enemy into her house, and suddenly her every move is watched; her life and her child’s life is at constant risk. Without food or money or hope, as danger escalates around her, she must make one terrible choice after another.</p><p>Vianne’s sister, Isabelle, is a rebellious eighteen-year-old girl, searching for purpose with all the reckless passion of youth. While thousands of Parisians march into the unknown terrors of war, she meets the compelling and mysterious Gäetan, a partisan who believes the French can fight the Nazis from within France, and she falls in love as only the young can...completely. When he betrays her, Isabelle races headlong into danger and joins the Resistance, never looking back or giving a thought to the real--and deadly--consequences.</p><p>Review by GoodReads</p>`,book2img:`<img src="https://images.gr-assets.com/books/1451446316l/21853621.jpg" alt="">`,book3:"<h3>A Tale of Two Cities</h3>  <h4>by Charles Dickens</h4>",book3des:"<p>After eighteen years as a political prisoner in the Bastille, the ageing Doctor Manette is finally released and reunited with his daughter in England. There the lives of two very different men, Charles Darnay, an exiled French aristocrat, and Sydney Carton, a disreputable but brilliant English lawyer, become enmeshed through their love for Lucie Manette. From the tranquil roads of London, they are drawn against their will to the vengeful, bloodstained streets of Paris at the height of the Reign of Terror, and they soon fall under the lethal shadow of La Guillotine.</p><p>Review by GoodReads</p>",book3img:`<img src="data:image/jpeg;base64," alt="">`,book4:"<h3></h3>  <h4></h4>",book4des:"<p></p><p>Review by GoodReads</p>",book4img:`<img src="" alt="">`,book5:"<h3>Alias Grace</h3>  <h4>by Margaret Atwood</h4>",book5des:"<p>It's 1843, and Grace Marks has been convicted for her involvement in the vicious murders of her employer and his housekeeper and mistress. Some believe Grace is innocent; others think her evil or insane. Now serving a life sentence, Grace claims to have no memory of the murders.</p><p>An up-and-coming expert in the burgeoning field of mental illness is engaged by a group of reformers and spiritualists who seek a pardon for Grace. He listens to her story while bringing her closer and closer to the day she cannot remember. What will he find in attempting to unlock her memories?</p><p>Review by GoodReads</p>",book5img:`<img src="data:image/jpeg;base64," alt="">` };
var INTJ = {title:"<h1>INTJ</h1>" ,book1:"<h3>Labyrinths: Selected Stories and Other Writings</h3>  <h4>by Jorge Luis Borges</h4>",book1des:`<p>Although his work has been restricted to the short story, the essay, and poetry, Jorge Luis Borges of Argentina is recognized all over the world as one of the most original and significant figures in modern literature. In his preface, Andre Maurois writes: "Borges is a great writer who has composed only little essays or short narratives. Yet they suffice for us to call him great because of their wonderful intelligence, their wealth of invention, and their tight, almost mathematical style."</p><p>Review by GoodReads</p>`,book1img:`<img src="data:image/jpeg;base64," alt="">`,book2:"<h3>The Ghost Map: The Story of London's Most Terrifying Epidemic - and How It Changed Science, Cities, and the Modern World</h3>  <h4>by Steven Johnson</h4>",book2des:"<p>From Steven Johnson, the dynamic thinker routinely compared to James Gleick, Dava Sobel, and Malcolm Gladwell, The Ghost Map is a riveting page-turner about a real-life historical hero, Dr. John Snow. It's the summer of 1854, and London is just emerging as one of the first modern cities in the world. But lacking the infrastructure -- garbage removal, clean water, sewers -- necessary to support its rapidly expanding population, the city has become the perfect breeding ground for a terrifying disease no one knows how to cure. As the cholera outbreak takes hold, a physician and a local curate are spurred to action-and ultimately solve the most pressing medical riddle of their time.</p><p>Review by GoodReads</p>",book2img:`<img src="data:image/jpeg;base64," alt="">`,book3:"<h3>Other-Wordly: Words Both Strange and Lovely from Around the World</h3>  <h4>by Yee-Lum Mak</h4>",book3des:"<p>Discover words to surprise, delight, and enamor. Learn terms for the sunlight that filters through the leaves of trees, for dancing awkwardly but with relish, and for the look shared by two people who each wish the other would speak first. Other-Wordly is an irresistible gift for lovers of words and those lost for words alike.</p><p>Review by GoodReads</p>",book3img:`<img src="data:image/jpeg;base64," alt="">`,book4:"<h3>Lost in Translation: An Illustrated Compendium of Untranslatable Words from Around the World </h3>  <h4>by Ella Frances Sanders </h4>",book4des:"<p>Lost in Translation brings to life more than fifty words that don’t have direct English translations with charming illustrations of their tender, poignant, and humorous definitions. Often these words provide insight into the cultures they come from, such as the Brazilian Portuguese word for running your fingers through a lover’s hair, the Italian word for being moved to tears by a story, or the Swedish word for a third cup of coffee.</p><p>Review by GoodReads</p>",book4img:`<img src="data:image/jpeg;base64," alt="">`,book5:"<h3>1984</h3>  <h4>by George Orwell</h4>",book5des:"<p>Among the seminal texts of the 20th century, Nineteen Eighty-Four is a rare work that grows more haunting as its futuristic purgatory becomes more real. Published in 1949, the book offers political satirist George Orwell's nightmarish vision of a totalitarian, bureaucratic world and one poor stiff's attempt to find individuality. The brilliance of the novel is Orwell's prescience of modern life—the ubiquity of television, the distortion of the language—and his ability to construct such a thorough version of hell. Required reading for students since it was published, it ranks among the most terrifying novels ever written. </p><p>Review by GoodReads</p>",book5img:`<img src="data:image/jpeg;base64," alt="">` };
var ISTP = {title:"<h1>ISTP</h1>" ,book1:"<h3>The Dark Tower Series</h3>  <h4>by Stephen King</h4>",book1des:"<p>The Dark Tower is a series of eight books written by American author Stephen King that incorporate themes from multiple genres, including dark fantasy, science fantasy, horror, and Western. It describes a gunslinger and his quest toward a tower, the nature of which is both physical and metaphorical. The series, and its use of the Dark Tower, expands upon Stephen King's multiverse and in doing so, links together many of his other novels.</p><p>Review by Wikipedia</p>",book1img:`<img src="data:image/jpeg;base64," alt="">`,book2:"<h3>The Hell Bent Kid</h3>  <h4>by Charles O. Locke</h4>",book2des:"<p>A crack shot more skilled with a rifle than are men twice his age, eighteen-year-old Tot Lohman has no intention of using his genius for evil. But when a fight erupts at a schoolhouse dance, Lohman is forced to defend himself, and a young rancher named Shorty Boyd winds up dead. The Boyds are numerous, powerful, and vicious, and they want revenge. With no one else to turn to, Lohman sets out across canyon country to reunite with his ailing father in New Mexico Territory. The journey will be long, hot, and perilous, and to survive it, this mild-mannered boy must become the cold-blooded killer he never wanted to be.</p><p>Review by GoodReads</p>",book2img:`<img src="data:image/jpeg;base64," alt="">`,book3:"<h3>Lonesome Dove</h3>  <h4>by Larry McMurtry</h4>",book3des:"<p>Journey to the dusty little Texas town of Lonesome Dove and meet an unforgettable assortment of heroes and outlaws, whores and ladies, Indians and settlers. Richly authentic, beautifully written, always dramatic, Lonesome Dove is a book to make us laugh, weep, dream, and remember.</p><p>Review by GoodReads</p>",book3img:`<img src="data:image/jpeg;base64," alt="">`,book4:"<h3>Bury My Heart at Wounded Knee: An Indian History of the American West</h3>  <h4>by Dee Brown</h4>",book4des:"<p>Bury My Heart at Wounded Knee is Dee Brown's eloquent, fully documented account of the systematic destruction of the American Indian during the second half of the nineteenth century. A national bestseller in hardcover for more than a year after its initial publication, it has sold almost four million copies and has been translated into seventeen languages. For this elegant thirtieth-anniversary edition—published in both hardcover and paperback—Brown has contributed an incisive new preface.</p><p>Using council records, autobiographies, and firsthand descriptions, Brown allows the great chiefs and warriors of the Dakota, Ute, Sioux, Cheyenne, and other tribes to tell us in their own words of the battles, massacres, and broken treaties that finally left them demoralized and defeated. A unique and disturbing narrative told with force and clarity, Bury My Heart at Wounded Knee changed forever our vision of how the West was really won.</p><p>Review by GoodReads</p>",book4img:`<img src="data:image/jpeg;base64," alt="">`,book5:"<h3>Riders of the Purple Sage</h3>  <h4>by Zane Grey</h4>",book5des:"<p>Riders of the Purple Sage is a classic of the Western genre. It is the story of Lassiter, a gunslinging avenger in black, who shows up in a remote Utah town just in time to save the young and beautiful rancher Jane Withersteen from having to marry a Mormon elder against her will. Lassiter is on his own quest, one that ends when he discovers a secret grave on Jane’s grounds. </p><p>Review by GoodReads</p>",book5img:`<img src="data:image/jpeg;base64," alt="">` };
var ISFP = {title:"<h1>ISFP</h1>" ,book1:"<h3>Fairy Tales from the Brothers Grimm</h3>  <h4>by Philip Pullman (Editor),  Jacob Grimm, Wilhelm Grimm</h4>",book1des:"<p>From much-loved stories like “Cinderella” and “Rumpelstiltskin,” “Rapunzel” and “Hansel and Gretel” to lesser-known treasures like “Briar-Rose,” “Thousandfurs,” and “The Girl with No Hands,” Pullman retells his fifty favorites, paying homage to the tales that inspired his unique creative vision—and that continue to cast their spell on the Western imagination.</p><p>Review by GoodReads</p>",book1img:`<img src="data:image/jpeg;base64," alt="">`,book2:"<h3>Bloodsucking Fiends Series</h3>  <h4>by Christopher Moore </h4>",book2des:"<p>Jody never asked to become a vampire. But when she wakes up under an alley dumpster with a badly burned arm, an aching neck, superhuman strength, and a distinctly Nosferatuan thirst, she realizes the decision has been made for her.</p><p>Making the transition from the nine-to-five grind to an eternity of nocturnal prowlings is going to take some doing, however, and that's where C. Thomas Flood fits in. A would-be Kerouac from Incontinence, Indiana, Tommy (to his friends) is biding his time night-clerking and frozen-turkey bowling in a San Francisco Safeway. But all that changes when a beautiful undead redhead walks through the door ... and proceeds to rock Tommy's life -- and afterlife -- in ways he never imagined possible.</p><p>Review by GoodReads</p>",book2img:`<img src="data:image/jpeg;base64," alt="">`,book3:"<h3>Libriomancer</h3>  <h4>by Jim C. Hines</h4>",book3des:"<p>Isaac Vainio is a Libriomancer, a member of the secret organization founded five centuries ago by Johannes Gutenberg. Libriomancers are gifted with the ability to magically reach into books and draw forth objects. When Isaac is attacked by vampires that leaked from the pages of books into our world, he barely manages to escape. To his horror he discovers that vampires have been attacking other magic-users as well, and Gutenberg has been kidnapped.</p><p>With the help of a motorcycle-riding dryad who packs a pair of oak cudgels, Isaac finds himself hunting the unknown dark power that has been manipulating humans and vampires alike. And his search will uncover dangerous secrets about Libriomancy, Gutenberg, and the history of magic. . .</p><p>Review by GoodReads</p>",book3img:`<img src="data:image/jpeg;base64," alt="">`,book4:"<h3>The Language of Flowers</h3>  <h4>by Vanessa Diffenbaugh</h4>",book4des:"<p>The Victorian language of flowers was used to convey romantic expressions: honeysuckle for devotion, asters for patience, and red roses for love. But for Victoria Jones, it's been more useful in communicating grief, mistrust, and solitude. After a childhood spent in the foster-care system, she is unable to get close to anybody, and her only connection to the world is through flowers and their meanings</p><p>Now eighteen and emancipated from the system, Victoria has nowhere to go and sleeps in a public park, where she plants a small garden of her own. Soon a local florist discovers her talents, and Victoria realizes she has a gift for helping others through the flowers she chooses for them. But a mysterious vendor at the flower market has her questioning what's been missing in her life, and when she's forced to confront a painful secret from her past, she must decide whether it's worth risking everything for a second chance at happiness.</p><p>Review by GoodReads</p>",book4img:`<img src="data:image/jpeg;base64," alt="">`,book5:"<h3>Wuthering Heights</h3>  <h4>by Emily Brontë</h4>",book5des:"<p>Published in 1847, the year before Emily Bronte’s death at the age of thirty, Wuthering Heights has proved to be one of the nineteenth century’s most popular yet disturbing masterpieces. The windswept moors are the unforgettable setting of this tale of the love between the foundling Heathcliff and his wealthy benefactor’s daughter, Catherine. Through Catherine’s betrayal of Heathcliff and his bitter vengeance, their mythic passion haunts the next generation even after their deaths. Incorporating elements of many genres—from gothic novels and ghost stories to poetic allegory—and transcending them all, Wuthering Heights is a mystifying and powerful tour de force.</p><p>Review by Penguin Random House</p>",book5img:`<img src="data:image/jpeg;base64," alt="">` };
var INFP = {title:"<h1>INFP</h1>" ,book1:"<h3>Levels of Life</h3>  <h4>by Julian Barnes</h4>",book1des:"<p>Julian Barnes's new book is about ballooning, photography, love and grief; about putting two things, and two people, together, and about tearing them apart.</p><p>Review by GoodReads</p>",book1img:`<img src="data:image/jpeg;base64," alt="">`,book2:"<h3>The Lord of the Rings Book Series</h3>  <h4>by J. R. R. Tolkien</h4>",book2des:`<p>The title of the novel refers to the story's main antagonist, the Dark Lord Sauron,[a] who had in an earlier age created the One Ring to rule the other Rings of Power as the ultimate weapon in his campaign to conquer and rule all of Middle-earth. From quiet beginnings in the Shire, a hobbit land not unlike the English countryside, the story ranges across Middle-earth, following the course of the War of the Ring through the eyes of its characters, not only the hobbits Frodo Baggins, Samwise "Sam" Gamgee, Meriadoc "Merry" Brandybuck and Peregrin "Pippin" Took, but also the hobbits' chief allies and travelling companions: the Men, Aragorn, a Ranger of the North, and Boromir, a Captain of Gondor; Gimli, a Dwarf warrior; Legolas, an Elven prince; and Gandalf, a wizard</p><p>Review by Wikipedia</p>`,book2img:`<img src="data:image/png;base64," alt="">`,book3:"<h3>Watership Down</h3>  <h4>by Richard Adams</h4>",book3des:"<p>Set in England's Downs, a once idyllic rural landscape, this stirring tale of adventure, courage and survival follows a band of very special creatures on their flight from the intrusion of man and the certain destruction of their home. Led by a stouthearted pair of friends, they journey forth from their native Sandleford Warren through the harrowing trials posed by predators and adversaries, to a mysterious promised land and a more perfect society.</p><p>Review by GoodReads</p>",book3img:`<img src="data:image/jpeg;base64," alt="">`,book4:"<h3>The Comprehensive INFP Survival Guide</h3>  <h4>by Heidi Priebe</h4>",book4des:"<p>Despite their agreeable demeanor, INFPs represent one of the most passionate and complex personality types within the Myers-Briggs Inventory</p><p>Review by GoogleBooks</p>",book4img:`<img src="data:image/jpeg;base64," alt="">`,book5:"<h3>The Chronicles of Narnia </h3>  <h4>by C. S. Lewis</h4>",book5des:`<p>It narrates the adventures of various children who play central roles in the unfolding history of the Narnian world. Except in The Horse and His Boy, the protagonists are all children from the real world who are magically transported to Narnia, where they are sometimes called upon by the lion Aslan to protect Narnia from evil. The books span the entire history of Narnia, from its creation in The Magician's Nephew to its eventual destruction in The Last Battle.</p><p>Review by GoodReads</p>`,book5img:`<img src="https://images-na.ssl-images-amazon.com/images/I/51xt5vB1JiL._SX294_BO1,204,203,200_.jpg" alt="">` };
var INTP = {title:"<h1>INTP</h1>" ,book1:"<h3>The Spy Who Came In from the Cold</h3>  <h4>by John le Carré</h4>",book1des:"<p>When the last agent under his command is killed and Alec Leamas is called back to London, he hopes to come in from the cold for good. His spymaster, Control, however, has other plans. Determined to bring down the head of East German Intelligence and topple his organization, Control once more sends Leamas into the fray -- this time to play the part of the dishonored spy and lure the enemy to his ultimate defeat.</p><p>Review by GoodReads</p>",book1img:`<img src="data:image/jpeg;base64," alt="">`,book2:"<h3>Slaughterhouse-Five</h3>  <h4>by Kurt Vonnegut</h4>",book2des:"<p>Selected by the Modern Library as one of the 100 best novels of all time, Slaughterhouse-Five, an American classic, is one of the world's great antiwar books. Centering on the infamous firebombing of Dresden, Billy Pilgrim's odyssey through time reflects the mythic journey of our own fractured lives as we search for meaning in what we fear most.</p><p>Review by GoodReads</p>",book2img:`<img src="https://images.gr-assets.com/books/1440319389l/4981.jpg" alt="">`,book3:"<h3>Gulliver's Travels</h3>  <h4>by Jonathan Swift</h4>",book3des:"<p>Shipwrecked and cast adrift, Lemuel Gulliver wakes to find himself on Lilliput, an island inhabited by little people, whose height makes their quarrels over fashion and fame seem ridiculous. His subsequent encounters - with the crude giants of Brobdingnag, the philosophical Houyhnhnms and the brutish Yahoos - give Gulliver new, bitter insights into human behaviour. Swift's savage satire view mankind in a distorted hall of mirrors as a diminished, magnified and finally bestial species, presenting us with an uncompromising reflection of ourselves.</p><p>Review by GoodReads</p>",book3img:`<img src="data:image/jpeg;base64," alt="">`,book4:"<h3>What is Not Yours is Not Yours</h3>  <h4>by Helen Oyeyemi</h4>",book4des:`<p>The key to a house, the key to a heart, the key to a secret—Oyeyemi’s keys not only unlock elements of her characters’ lives, they promise further labyrinths on the other side. In “Books and Roses” one special key opens a library, a garden, and clues to at least two lovers’ fates. In “Is Your Blood as Red as This?” an unlikely key opens the heart of a student at a puppeteering school. “‘Sorry’ Doesn’t Sweeten Her Tea” involves a “house of locks,” where doors can be closed only with a key—with surprising, unobservable developments. And in “If a Book Is Locked There’s Probably a Good Reason for That Don't You Think,” a key keeps a mystical diary locked (for good reason).</p><p>Review by GoodReads</p>`,book4img:`<img src="data:image/jpeg;base64," alt="">`,book5:"<h3>Heartbreaker</h3>  <h4>by Maryse Meijer</h4>",book5des:"<p>In her debut story collection Heartbreaker, Maryse Meijer peels back the crust of normalcy and convention, unmasking the fury and violence we are willing to inflict in the name of love and loneliness. Her characters are a strange ensemble—a feral child, a girl raised from the dead, a possible pedophile—who share in vulnerability and heartache, but maintain an unremitting will to survive. Meijer deals in desire and sex, femininity and masculinity, family and girlhood, crafting a landscape of appetites threatening to self-destruct. In beautifully restrained and exacting prose, she sets the marginalized free to roam her pages and burn our assumptions to the ground.</p><p>Review by GoodReads</p>",book5img:`<img src="data:image/jpeg;base64," alt="">` };
